    ranks = {u: 0 for u in g}
    min_cost = {u: float('inf') for u in g}
    def find(u):
        if parents[u]!= u:
            parents[u] = find(parents[u])
        return parents[u]

    def union(u, v):
        ru, rv = find(u), find(v)
        if ranks[ru] < ranks[rv]:
            parents[ru] = rv
        else:
            parents[rv] = ru
            if ranks[ru] == ranks[rv]:
                ranks[ru] += 1

    def find_and_union(u, v):
        union(u, v)
        min_cost[find(u)] = min(min_cost[find(u)], costs[u, v])

    def min_cost_route():
        for u, v in edges:
            find_and_union(u, v)

    min_cost_route()
    return sum(min_cost.values())

